import jsonPlaceholder from "../api/jsonPlaceholder"


export const fetchPosts = async () => {

    //request to api
    const response = await jsonPlaceholder.get('/posts')
    return {
        type: 'FETCH_POSTS',
        //data on payload property
        payload: response
    }
}
